import React from 'react';
import { useLocation } from 'react-router-dom';

export default function Results() {
    const { state } = useLocation();
    const { 
        average_distance, 
        average_elevation_change,
        average_heartrate,
        average_speed,
        activity_results,
        all_data 
    } = state;

    return (
        <div>
            <p style={{color: '#000'}}>{ activity_results }</p>
        </div>
    );
}
